"""
    Quero tentar criar um MLP para reconhecer padrões de desenho em vetores de texto de forma que ele consiga reproduzir na saída
    uma matriz que quando multiplicada pela matriz de entrada anule os caracteres do padrão de desenho, ficando apenas a mensagem
    do texto.
"""
import math
from statistics import median
from random import randint, shuffle

def handleData(file_path, answer_patch):
    dataNum = []
    expected = []
    try:
        with open(file_path, 'r') as file:
            dataText = file.read().split(';')
            for i in dataText[:-1]:
                dataNum.append([ord(item) for item in i[:-1]])
    except FileNotFoundError:
        print(f"O arquivo {file_path} não foi encontrado.")
        exit()
    
    try:
        with open(answer_patch, 'r') as file:
            e = file.read().split(';')
            for i in e[:-1]:
                expected.append([int(c) for c in i.split(' ')[:-1]])
    except FileNotFoundError:
        print(f"O arquivo {answer_patch} não foi encontrado.")
        exit()

    for item in range(0, len(dataNum)):

        # o numero de caracteres ASCII aleatórios que serão colocados
        if(len(dataNum[item]) < 60):
            f = math.ceil( (60-len(dataNum[item]))/2 )
            dataNum[item] = [randint(0, 127) for _ in range(0, f )] + dataNum[item] + [randint(0, 127) for _ in range(0, f - 1)]
            expected[item] = [1 for _ in range(0, f )] + expected[item] + [1 for _ in range(0, f - 1)]
        else:
            pass
        if(len(dataNum[item]) < 60):
            while (len(dataNum[item]) < 60):
                dataNum[item] = dataNum[item] + [32]
        
        if(len(expected[item]) < 60):
            while (len(expected[item]) < 60):
                expected[item] = expected[item] + [32]
    
    for i in range(0, len(dataNum)):
        dataNum[i] = [dataNum[i], expected[i]]
    return dataNum

def createPattern(n=3):
    """
        cria os vetores para treinamento da rede
        :param n: o número de * - ou ~ que é considerado um padrão
        :type n: int
    """

    # Valor ASCII do caractere '*'
    asterisk_ascii_value = ord('*')

    # Tamanho do vetor
    vector_size = 50

    # Criação de vetores com a quantidade desejada de caracteres '*'
    vectors = []
    expectedVector = []
    realVectors = []
    realExpected = []
    if( n < 3):
        n = 3
    for k in range(0, 3):
        if k == 0:
            asterisk_ascii_value = ord('*')
        elif k == 1:
            asterisk_ascii_value = ord('-')
        elif k == 2:
            asterisk_ascii_value = ord('~')
        for c in range(3, n+1):
            for _ in range(10):
                # Inicializa um vetor preenchido com valores aleatórios da tabela ASCII
                vector = [randint(0, 127) for _ in range(vector_size)]
                
                # Substitui alguns valores no vetor pelo valor ASCII de '*'
                index_to_replace = randint(0, vector_size - 1)
                try:
                    for count in range(0, c):
                        vector[index_to_replace + count] = asterisk_ascii_value
                except:
                    for count in range(0, c):
                        vector[index_to_replace - count] = asterisk_ascii_value

                
                #adciona no vector
                if( _ < 8):
                    vectors.append(vector.copy())
                else:
                    realVectors.append(vector.copy())

                #adciona o valor esperado da saída em expectedVector
                try:
                    for count in range(0, c):
                        vector[index_to_replace + count] = ord(' ')
                except:
                    for count in range(0, c):
                        vector[index_to_replace - count] = ord(' ')

                if(_ < 8):
                    expectedVector.append(vector.copy())
                else:
                    realExpected.append(vector.copy())
    return vectors, expectedVector, realVectors, realExpected

def funcaoAtivacao1(x):
    """
        função de ativação da camada oculta
        :param x: o valor de x para a função de ativação
        :type x: float
    """
    if(x > 19):
        x = 19
    elif (x < -19):
        x = -19

    #função tangente hiperbólica
    r = ((math.e)**(x) - (math.e)**(-x))/((math.e)**(x) + (math.e)**(-x))
    return r

def funcaoAtivacao2(x):
    """
        função de ativação da camada oculta
        :param x: o valor de x para a função de ativação
        :type x: float
    """
    #não vamos utilizar mais a função sigmóide pois ela esta saturando
    r = 1/(1+(math.e)**(-x))
    return r

def derivadaFuncAtivacao1(y):
    """
        função que retorna a derivada da função de ativação com y = f(x) 
        :param x: o ponto onde x deve ser derivado
        :type x: float
    """

    if(y < -148):
        y = -1.4881167987926554e+2
    elif(y > 374):
        y = 374
    #no caso da func. tangente hiperbólica, não utilizamos y como sendo resultado de f(x), mas como sendo x puro, que é o próprio y
    derivada =(2/(math.e)**y + (math.e)**(-y))**2
    return derivada

def derivadaFuncAtivacao2(y):
    """
        função que retorna a derivada da função de ativação com y = f(x) 
        :param x: o ponto onde x deve ser derivado
        :type x: float
    """
    #não vamos utilizar a função sigmóide,mas sim a tghiperbólica
    derivada = funcaoAtivacao1(y) * (1.0 - funcaoAtivacao1(y))
    return derivada

def perceptron(camada, entradas, bias, actv=1):
    """
        efetua os calculos do neurônio
        :param camada: a camada que iremos calcular
        :type camada: array
        :param entradas: as entradas de cada conexão do neurônio
        :type entradas: array
        :param bias: o bias
        :type bias: float
        :rtype: none
    """
    arrSomatorios = []
    for neuronio in range(0, len(camada)):
        #somatório
        somatorio = 0.0

        for conn in range(0, len(camada[neuronio][0])):
            try:
                #print(f'{somatorio} += {camada[neuronio][0][conn]} * {entradas[neuronio]} + {bias}')
                somatorio += camada[neuronio][0][conn] * entradas[neuronio][conn] + bias
            except:
                try:
                    somatorio += camada[neuronio][0][conn] * entradas[conn] + bias
                except:
                    somatorio += camada[neuronio][0][conn] * entradas[conn][0] + bias
        """ if(abs(somatorio) > 50):
            somatorio = (somatorio*50)/abs(somatorio) """

        #função de ativação
        if(actv == 1):
            r = funcaoAtivacao1(somatorio)
        elif actv == 2:
            r = funcaoAtivacao2(somatorio)
        camada[neuronio][1] = r
        #exibe a saída do neurônio 'n' da camada
        #print(f'-=-=-=-=-=-=-=-=-=-=-=- saída do {neuronio}º neuronio da camada: {camada[neuronio][1]} -=-=-=-=-=-=-=-=-=-=-=-')
        
        #guarda o valor do somatório do n-ézimo neurônio
        arrSomatorios.append(somatorio)
    return arrSomatorios

def respostaCamada(camada):
	"""
		retorna a resposta de uma camada de neurônios
		:param camada: a camada que queremos pegar o resultado
		:type camada: array
		:rtype: array
	"""
	resp = []
	for neuronio in range(0, len(camada)):
		resp.append(camada[neuronio][1])
	return resp

def gradienteErroSaida(saidaRede, saidaEsperada, f=1):
    """
        calcula o gradiente de erro da saída, segundo proposto pela professora Ariane Machado Lima (USP):
        https://edisciplinas.usp.br/pluginfile.php/4457290/mod_resource/content/2/SIN5007-Tema08-RedesNeurais.pdf
        :param saidaRede: a saída da rede
        :type saidaRede: float
        :param saidaEsperada: a saída esperada da rede
        :type saidaEsperada: float
        :param somatorioNeuronio: os somatórios dos neurônios antes de passarem pela função de ativação
        :type somatorioNeuronio: array.
        :rtype: array
    """
    erro = []
    if f == 1:
        for item in range(0, len(saidaEsperada)):
            erro.append((saidaEsperada[item] - saidaRede[item]) * derivadaFuncAtivacao1(saidaRede[item]))
    elif f == 2:
        for item in range(0, len(saidaEsperada)):
            erro.append((saidaEsperada[item] - saidaRede[item]) * derivadaFuncAtivacao2(saidaRede[item]))
    return erro

def gradienteErroOculto(camadaSaida, erroSaida, posNeuronioOculto, somatorioOculto, f=1):
    """
        calcula o gradiente de erro de um neurônio j da camada oculta.
        faz a soma ponderada de todas as conexões que este neurônio faz com a camada de saída e retorna este resultado multiplicado pela f'(x)
        :param camadaSaida: a camada da frente, com seus neurônios.
        :type saidaRede: array.
        :param erroSaida: os erros calculados da camada de saida da rede.
        :type saidaEsperada: array.
        :param numeroNeuronioOculto: a posição do neurônio oculto na camada oculta.
        :type numeroNeuronioOculto: int.
        :param somatorioNeuronio: o somatório da camada oculta no neuronio que estamos pegando o erro.
        :type somatorioNeuronio: float.
        :rtype: float
    """
    somatorio = 0.0
    #para cada neurônio na camada de saída que faz conexão com o neurônio da camada oculta
    for neuronioSaida in range(0, len(camadaSaida)):
        #somatório (que é negativo), soma o erro da saida do neurônioSaida multiplicado pelo peso da sua conexão com o neurônio oculto
        somatorio += erroSaida[neuronioSaida] * camadaSaida[neuronioSaida][0][posNeuronioOculto]

    #retorna o somatório vezes a derivada da função de ativação em x = somatório do neurônio oculto
    if f == 1:
        erro = somatorio * derivadaFuncAtivacao1(somatorioOculto[posNeuronioOculto])
    elif f == 2:
        erro = somatorio * derivadaFuncAtivacao2(somatorioOculto[posNeuronioOculto])

    return erro

def correcaoErro(camada, aprendizado, erro, entradaNeuronio):
    """
        corrige o erro dos neurônios
        :param camada: a camada que vamos corrigir o erro
        :type camada: array
        :param aprendizado: a taxa de aprendizado (fixa nesta rede)
        :type aprendizado: float
        :param erro: os erros dos neurônios da camada
        :type erro: array
        :param entradaNeuronio: as entradas que o neurônio recebeu
        :type entradaNeuronio: array
        :rtype: none
    """

    for neuronio in range(0, len(camada)):
        for conn in range(0, len(camada[neuronio][0])):
            #print(f'erro = {camada[neuronio][0][conn]} + {aprendizado} * {erro[neuronio]} * {entradaNeuronio[conn]}')
            try:
                delta = + aprendizado * erro[neuronio] * entradaNeuronio[conn]
                camada[neuronio][0][conn] += delta
            except:
                delta = + aprendizado * erro[neuronio] * entradaNeuronio[conn][0]
                camada[neuronio][0][conn] += delta

def correcaoBias(bias, respCamadaSaida, esperado):
    """
        corrige o peso da bias
        :param bias: o valor atual do bias
        :type bias: float
        :param erro: o valor do erro da camada de saída
        :type erro: float
        :param aprendizado: a taxa de aprendizado da rede (fixa em nosso caso)
        :type aprendizado: float
        :rtype: float
    """
    #print(f'bias = {bias} + {aprendizado} * {erro}')
    sumError = 0.0
    
    for item in range(0, len(respCamadaSaida)):
        sumError += (esperado[item] - respCamadaSaida[item]) ** 2

    bias += aprendizado * (1/2 * sumError) * derivadaFuncAtivacao1(funcaoAtivacao1(sumError))
    #bias += aprendizado * sumError
    return bias

def resultados(respCamadaSaida, esperado):
    #print(f'{respCamadaSaida} ?= {esperado}')

    #criando o rol
    rol = respCamadaSaida.copy()
    rol.sort()

    #tirando a mediana
    m = median(rol)

    #matriz de comparação
    comp = []

    # interpreta a saída da rede
    for c in range(0, len(respCamadaSaida)):
        if(respCamadaSaida[c] >= m):
            comp.append(1)
        else:
            comp.append(0)
    
    c = 0
    #conta o número efetivo de acertos
    for i in range(0, len(respCamadaSaida)):
        if comp[i] == esperado[i]:
            c += 1
    print(c)

    #exibe a saída esperada da camada
    if(comp == esperado):
        #print(f'ACERTOU')
        return c
    else:
        #print(f'ERROU')
        return c

def media(g):
    m = 0
    for i in g:
        m += i
    
    m = m/len(g)
    print(f'-=-=-=-=-=-=-=-=-=-=-=-= média de {m} acertos -=-=-=-=-=-=-=-=-=-=')
    return m

